export default class Contacts {
   static GET_CONTACTS_TARGETS = MAIN_PATH + '/';
   static GET_CONTACT_TARGET_BY_ID = MAIN_PATH + '/';
   static UPDATE_CONTACT_TARGET = MAIN_PATH + '/';
   static DELETE_CONTACT_TARGET_BY_ID = MAIN_PATH + '/';
}
